import React from 'react';

export default class Form extends React.Component {
    state = {
        firstName: '',
        lastName: '',
        userName: '',
        email: '',
        creditCard: ''
    }

    change = (e) => {
        this.setState({
            [e.target.name]: e.target.value
        });
    };

    render() {
        return (
            <form>
                <input name="firstName" placeholder="First name" value={this.state.firstName} onChange={e => this.change(e)}/>
                <br></br>
                <input placeholder="Last name" value={this.state.lastName} onChange={e => this.setState({ lastName: e.target.value})}/>
                <br></br>
                <input placeholder="Username" value={this.state.userName} onChange={e => this.setState({ userName: e.target.value})}/>
                <br></br>
                <input placeholder="Email" value={this.state.email} onChange={e => this.setState({ email: e.target.value})}/>
                <br></br>
                <input placeholder="Credit card" value={this.state.creditCard} onChange={e => this.setState({ creditCard: e.target.value})}/>

            </form>
        );
    }
}
